angular.module('app').directive('loading', function() {
  return {
		restrict: 'E',
    transclude: true,
		scope: {
				active: '=',
		 },
    templateUrl: 'directives/loading'
  };
});

angular.module('app').controller('homeController', function($scope, $code, $state, $stateParams, $user, $location) {

    $user.storeUser($stateParams);

    $location.url($location.path());

    $scope.loading = false;

    $scope.reveal = function(code) {
        if (!$scope.loading) {
            $scope.loading = true;
            $code.lookup(code).then(function(success) {
                $scope.error = false;
                console.log(success);
                if(success.revealed){
                  if (success.reveal.status == "APPROVED") {
                      $state.go('gift', {
                          revealId: success.reveal._id
                      })
                  } else {
                      $state.go('sign', {
                          revealId: success.reveal._id
                      })
                  }
                }else if ($user.getUser() && $user.user.email && $user.user.name.first && $user.user.name.last) {
                    $code.reveal($user.user.name, $user.user.email, code).then(function(reveal) {
                        $scope.loading = false;
                        console.log(reveal);
                        if (reveal.status == "APPROVED") {
                            $state.go('gift', {
                                revealId: reveal._id
                            })
                        } else {
                            $state.go('sign', {
                                revealId: reveal._id
                            })
                        }
                    });
                } else {
                    $scope.loading = false;

                    $state.go('revealed', {
                        code: success.code
                    });
                }
            }).catch(function(error) {
                $scope.error = error;
                $scope.loading = false;
            });
        }
    }




});

angular.module('app').controller('revealedController', function($scope, $code, $state, $stateParams, $user) {

$scope.loading = true;

$code.lookup($stateParams.code).then(function(code){
  $scope.code = code;
  $scope.loading = false;
});

$scope.user = {
  name: {},
  email: ''
};

$scope.confirm = false;


if($user.getUser()){
  $scope.confirm = true;
  $scope.user = $user.user;
}

$scope.continue = function(name, email){

  if(!$scope.loading){


  $code.reveal(name, email, $stateParams.code).then(function(reveal){
    if(reveal.status == "APPROVED"){
      $state.go('gift', {revealId: reveal._id})
    }else{
      $state.go('sign', {revealId: reveal._id})
    }
  });

   }

  $scope.loading = true;


}



});

angular.module('app').factory('$code', function($talk, $state){
  return {
    lookup: function(code){
      return $talk.get('lookup/'+code);
    },
    reveal: function(name, email, code){
      return $talk.post('reveal', {name: name, email: email, code: code});
    }
  };
});

angular.module('app').factory('$reveal', function($talk, $state){
  return {
    get: function(revealId){
      return $talk.get('reveal/' + revealId);
    },
    reward: function(revealId){
      return $talk.get('reward/' + revealId);
    }
  };
});

angular.module('app').factory('$talk', function($http, $state){
  var apiUrl = '/api/';
  var errorHandler = function(response){
     if(response.status === 401 && !$state.is('login') && !$state.is('register')){
       return $state.go('login');
     }
     throw response.data;
  };

  var inputHandler = (response) => {
    return response.data;
  }

  return {
    get: function(url, headers){
      if(!headers){
        headers = {};
      }
      headers.withCredentials = true;
      return $http.get(apiUrl+url, headers).catch(errorHandler).then(inputHandler)
    },

    post: function(url, body, headers){
      if(!headers){
        headers = {};
      }
      headers.withCredentials = true;
      return $http.post(apiUrl+url, body, headers).catch(errorHandler).then(inputHandler)
    }
  };
});

angular.module('app').factory('$user', function($talk, $state) {
    return {
        user: null,
        storeUser: function(user) {
            if (user.email && user.first_name && user.last_name) {
                var user = {
                    name: {
                        first: user.first_name,
                        last: user.last_name
                    },
                    email: user.email
                };
                localStorage.setItem('user', JSON.stringify(user));
                this.user = user;
            }
        },
        getUser: function() {
            if (this.user) {
                return this.user;
            }
            var user = localStorage.getItem('user');
            if (user) {
                this.user = JSON.parse(user);
                return this.user;
            }
            return null;
        }
    };
});

